import "./Login.css";

function Login() {
  return (
    <div className="login">
      <img
        className="login__logo"
        src="https://upload.wikimedia.org/wikipedia/commons/thumb/a/a9/Amazon_logo.svg/1024px"
      />
    </div>
  );
}

export default Login;
